                PARTITION BY {{ automate_dv.prefix([src_pk], 'current_records') }}
                ORDER BY {{ automate_dv.prefix([src_ldts], 'current_records') }} DESC
            ) AS rank
        FROM {{ this }} AS current_records
            JOIN (
                SELECT DISTINCT {{ automate_dv.prefix([src_pk], 'source_data') }}
