            ) AS source_records
                ON {{ automate_dv.multikey(src_pk, prefix=['current_records','source_records'], condition='=') }}
    ) AS a
    WHERE a.rank = 1
),

{%- endif %}

{%- if enable_ghost_record %}

ghost AS (
{{- automate_dv.create_ghost_record(src_pk, src_hashdiff, src_payload, src_extra_columns, src_eff, src_ldts, src_source, source_model) }}
